import styled from "styled-components";
const MainWapper = styled.div``;

const HomeWapper = styled.section``;
const Home = () => (
  <MainWapper>
    <h1>hi there!</h1>
    <div style={{ height: "200vh" }}></div>
  </MainWapper>
);

export default Home;
